import React from "react";

function Post() {
  return (
    <div>
      <main>
        <div className="head">
            <header>
                <div><i class="far fa-user-circle"></i></div>
                <div></div>
            </header>
        </div>
        <div className="body"></div>
        <div className="foot"></div>
      </main>
    </div>
  );
}

export default Post;
